import React from 'react'

const Navbar = () => {
    return (
        <div className="bg-gray-800">
            <div className="h-20 flex items-center">
                <p className="text-white font-bold px-10 tracking-wider">Employee Managament System</p>

            </div>
        </div>
    )
}

export default Navbar
